import { Box } from "@mui/material";
import React from "react";

const TheirMessage = ({ message }) => {
  return (
    <Box
      className="message"
      float="left"
      backgroundColor="chats.orange"
      ml="4px"
      width="fit-content"
      p="10px 18.2px 10px 10px"
      maxWidth="518px"
    >
      {message}
    </Box>
  );
};

export default TheirMessage;
